import React, { useEffect} from "react";
import { useDispatch, useSelector } from 'react-redux';
import { getDetail, clearDetail, removePokemon } from '../../actions';
import { useHistory } from "react-router-dom";
import style from "./pokemon.module.css";
import Stats from "../Stats";

export const Pokemon = () => (props) => { 
  const dispatch = useDispatch();
  const history = useHistory();

  useEffect(() => {
    dispatch(getDetail(props.match.params.id));
    return () => {
        dispatch(clearDetail());
    }
} , [ dispatch, props.match.params.id]);

const pokemon = useSelector(state => state.Details);

  const handleDelete = () => {
      dispatch(removePokemon(pokemon[0].id));
      alert('Pokemon deleted successfully');
      history.push("/home");
  };

  const addTeam = (obj) => {
    let array = [];
    if (localStorage.getItem("team")) {
      array = localStorage.getItem("team");
      array = JSON.parse(array);
     let exist = array.filter(o => o.name === obj.name)
      if(exist.length !== 0) return alert('Pokemon already in team')
      if (array.length >= 6) return alert('Your team cannot have more than six Pokemons');
      array.push(obj);
      localStorage.setItem("team", JSON.stringify(array));
    } else {
      array.push(obj);
      localStorage.setItem("team", JSON.stringify(array));
    }
    history.push("/team");
  };

  return (
      <div className={style.container}>
        {
          pokemon.length > 0 ?
          <div className={style.inner}>
        <h1>{pokemon.name}</h1>
        <h2>#{pokemon.id}</h2>

        <div class={style.pokebola}>
          <p>Catch</p>
          <button
            onClick={() => {
              addTeam({
                id: pokemon.id,
                name: pokemon.name,
                type: pokemon.type,
                img: pokemon.img,
              });
            }}
          >
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/5/51/Pokebola-pokeball-png-0.png"
              alt=""
            />
          </button>
        </div>

        <div className={style.ima}>
          <img src={pokemon.img} alt="" />
          <div className={style.parrafo}>
            <p>Weigth:<br/>{pokemon.weight}kgs</p>
            <br/>
            <p>Heigth:<br/>{pokemon.height}fts</p>
          </div>
        </div>

        <div className={style.type}>
          {pokemon.type
            ? pokemon?.type.map((t) => <h3 className={style[`${t}`]}>{t}</h3>)
            : null}
        </div>
        {
          pokemon[0].oficial ? <button onClick= {handleDelete} className='bt'>Remove Pokemon</button> : null
        }
        <div className={style.meter}>
          <div className={style.type}>
            <Stats valor={pokemon.hp} nombre={"Life"} />
            <Stats valor={pokemon.speed} nombre={"Speed"} />
          </div>
          <div className={style.type}>
            <Stats valor={pokemon.spDef} nombre={"Special Defense"} />
            <Stats valor={pokemon.spAtk} nombre={"Special Attack"} />
          </div>
          <div className={style.type}>
            <Stats valor={pokemon.defense} nombre={"Defence"} />
            <Stats valor={pokemon.attack} nombre={"Attack"} />
          </div>
        </div>
        </div>
        : <div>
            <img src="https://media.baamboozle.com/uploads/images/125978/1629738053_29014_gif-url.gif" alt="loading"/>
          </div>
        }
      </div>
  );
};
